import React from 'react';
import Link from 'next/link'


class Header extends React.Component {
  render() {
    debugger;
    const title = this.props.title; 
    return(
      <React.Fragment>
        <p>{title}</p>
        {this.props.children}
        <Link href = "/">
          <a style={{'fontSize':'20'}}> Home</a>
        </Link>
        <Link href = "/about">
          <a> About</a>
        </Link>
        <Link href = "/portfolio">
          <a> Portfolio</a>
        </Link>
        <Link href = "/blogs">
          <a> Blog</a>
        </Link>
        <Link href = "/cv">
          <a> CV</a>
        </Link>

      </React.Fragment>

    )
  }
}
export default Header;
